import React from "react";
import "./style.css";
import { Navbar, NavItem } from 'react-materialize';

const NavBar = props => {
    const { handleSignUpClick } = props;
    const { handleLoginClick } = props;
    return (
        <div>
            <Navbar brand={<a />} alignLinks="right" className="header">
                <NavItem href="" onClick={handleLoginClick} className="white-text login valign-wrapper modal-trigger">
                    Login
            </NavItem>
                <NavItem href="" onClick={handleSignUpClick} className="white-text signup valign-wrapper modal-trigger">
                    Signup
            </NavItem>
                <NavItem href="/categories" className="fridge">
                    Fridge
            </NavItem>
            </Navbar>
            <div className="center-align">
                <img src="./images/mish-mash-white.png" width="500" alt="Logo" className="top-logo" />
            </div>

        </div>
    );
}

export default NavBar;
